/* GENERATED FILE */
import * as React from 'react';
import Svg, { Rect, Ellipse, Path, Line } from 'react-native-svg';

import { IconProps } from '../lib';

function CoinVertical(props: IconProps) {
  return (
    <Svg
      viewBox="0 0 256 256"
      width={props.size}
      height={props.size}
      fill={props.color}
      {...props}
    >
      <Rect width={256} height={256} fill="none" />
      <Ellipse cx={104} cy={128} rx={56} ry={96} opacity={0.2} />
      <Ellipse
        cx={104}
        cy={128}
        rx={56}
        ry={96}
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
      <Path
        d="M104,32h48c30.9,0,56,43,56,96s-25.1,96-56,96H104"
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
      <Line
        x1={145.7}
        y1={64}
        x2={193.7}
        y2={64}
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
      <Line
        x1={160}
        y1={128}
        x2={208}
        y2={128}
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
      <Line
        x1={145.7}
        y1={192}
        x2={193.7}
        y2={192}
        fill="none"
        stroke={props.color}
        strokeLinecap="round"
        strokeLinejoin="round"
        strokeWidth={16}
      />
    </Svg>
  );
}

export default CoinVertical;
